import React from 'react'
import Link from 'next/link';


export const Nav = styled.nav`
    background: #000;
    height: 80px;
    margin-top: -80px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 1rem;
    position: sticky;
    top: 0;
    z-index: 10;
`

export const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    height: 80px;
    z-index: 1;
    width: 100%;
    padding: 0 24px;
    max-width: 1100px;
`

export const Logo = styled.div`
    background-image: url('../../image/bdot_logo.png');
`

export const NavMenu = styled.ul`
    display: flex;
    align-items: center;
    list-style: none;
    list-style: none;
    text-align: center;
    margin-right: -22px;
`

export const NavItem = styled.li`
    height: 80px;
` 
const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarCotainer>
                    <Link href="/">
                        <Logo/>
                    </Link>

                    <NavMenu>
                        <NavItem>
                            홈
                        </NavItem>

                        <NavItem>
                            닷비디오
                        </NavItem>

                        <NavItem>
                            팔로우
                        </NavItem>
                    </NavMenu>
                </NavbarCotainer>
            </Nav>
        </>
    )
}

export default Navbar
